import React from "react";
import Footer from "../HomeComponents/Footer";
import Header from "../HomeComponents/Header"; 
import Team from "../Team";

const InstructorOne = () => {
  return (
    <>
      <Header />
      <Team />
      <Footer />
    </>
  );
};

export default InstructorOne;
